# funo para calcular a posio da coluna
def index(mes, ano):
    posicao = (ano - 2021) * 12 + mes - 7
    posicao += 8  # comeando na coluna H
    return posicao

# funo para selecionar o sheet desejado
def selecionaSheet(gspread_client):
    # solicita ao usurio o caminho do arquivo no Google Drive
    file_path = input("Insira o ID ou URL do arquivo do Google Sheets no seu Drive: ").strip()

    try:
        if "https://" in file_path:
            # extrai o ID da URL se for uma URL completa
            file_id = file_path.split('/d/')[1].split('/')[0]
        else:
           # se no, acessa drive pelo endereo
            file_id = file_path

        # abre a planilha
        spreadsheet = gspread_client.open_by_key(file_id)
        print("Planilha carregada com sucesso!")

        # lista os nomes das folhas disponveis
        sheets = spreadsheet.worksheets()
        print("Sheets disponveis:")
        for idx, sheet in enumerate(sheets, start=1):
            print(f"{idx} - {sheet.title}")

        # solicita ao usurio a escolha do sheet
        choice = int(input("\nDigite o nmero do sheet que deseja acessar (ex.: 1 ou 2): ").strip())
        if choice < 1 or choice > len(sheets):
            print("Nmero invlido. Encerrando o programa.")
            return None, None

        sheet = sheets[choice - 1]
        print(f"Voc escolheu o sheet: {sheet.title}")
        return sheet, spreadsheet

    except Exception as e:
        print(f"Ocorreu um erro: {e}")
        return None, None

# funo para encontrar a ltima linha preenchida
def encontraUltimaLinha(sheet):
    values = sheet.get_all_values()
    for idx, row in enumerate(reversed(values), start=1):
        if any(cell.strip() for cell in row):  # verifica se h alguma clula no vazia
            return len(values) - idx + 2  # retorna a prxima linha +1 para pular uma linha
    return 2  # se no houver valores, comea na linha 2

# funo para inserir turma e alunos
def insereTurma(sheet):
    # encontra a ltima linha preenchida
    target_row = encontraUltimaLinha(sheet)

    # pergunta ao usurio o curso e o cdigo da turma
    curso = input("Digite o curso: ").strip()
    codigo_turma = input("Digite o cdigo da turma: ").strip()

    # define cabealho
    header = ["", "", "Curso/Turma", "Projeto Fundao", "Valor Total", "N de Parcelas", "Valor da Parcela"]
    sheet.update(values=[header], range_name=f"A{target_row}:G{target_row}")

    contador_alunos = 1
    while True:
        # nome do aluno ou para sair
        nome_aluno = input(f"Digite o nome do {contador_alunos} aluno (ou SAIR para finalizar): ").strip()
        if nome_aluno.upper() == "SAIR":
            print("Finalizando insero de alunos.")
            break

        # valor total para o aluno
        try:
            valor_total = float(input(f"Digite o valor total para {nome_aluno}: ").strip())
        except ValueError:
            print("Valor invlido. Tente novamente.")
            continue

        # nmero de parcelas
        try:
            num_parcelas = int(input(f"Digite o nmero de parcelas para {nome_aluno}: ").strip())
            if num_parcelas <= 0:
                raise ValueError
        except ValueError:
            print("Nmero de parcelas invlido. Tente novamente.")
            continue

        # ms e ano da primeira parcela
        try:
            mes_ano = input(f"Digite o ms e ano da primeira parcela no formato MM/AA para {nome_aluno}: ").strip()
            data_inicial = datetime.strptime(mes_ano, "%m/%y")
        except ValueError:
            print("Formato de data invlido. Tente novamente.")
            continue

        # calcula o valor da parcela
        valor_parcela = valor_total / num_parcelas

        # calcula a coluna para a primeira parcela
        primeira_parcela_col = index(data_inicial.month, data_inicial.year)

        # insere os dados do aluno (colunas A a G)
        aluno_data = [contador_alunos, nome_aluno, curso, codigo_turma, valor_total, num_parcelas, valor_parcela]
        sheet.update(values=[aluno_data], range_name=f"A{target_row + contador_alunos}:G{target_row + contador_alunos}")

        # insere o valor das parcelas nas colunas referentes
        for i in range(num_parcelas):
            col = primeira_parcela_col + i
            col_ref = gspread.utils.rowcol_to_a1(target_row + contador_alunos, col)
            sheet.update(values=[[valor_parcela]], range_name=col_ref)

        contador_alunos += 1

    # pergunta se deseja adicionar uma nova turma
    resposta = input("Gostaria de adicionar uma nova turma nesse departamento? (S - SIM / N - NO): ").strip().upper()
    if resposta == "S":
        insereTurma(sheet)  # chama novamente a funo
    elif resposta == "N":
        return False
    return True

# atualiza o main para usar a nova lgica
def main():
    # autenticao no Google Drive e Google Sheets
    auth.authenticate_user()
    creds, _ = default()
    creds.refresh(Request())
    gspread_client = gspread.authorize(creds)

    while True:
        # chama a funo de seleo de sheet
        sheet, spreadsheet = selecionaSheet(gspread_client)
        if not sheet:
            break  # encerra o programa se no conseguir selecionar o sheet

        # insere a turma e os alunos
        continuar = insereTurma(sheet)
        if not continuar:
            break  # sai do loop se o usurio no quiser adicionar mais turmas

if __name__ == "__main__":
    main()